import * as React from "react";
import styled from "styled-components";
export const Nav = () => {
  return (
    <StyledWrapper>
      <nav class="navbar navbar-expand-lg navbar-light bg-light">
        <div class="container-fluid">
          <a class="navbar-brand" href="#">
            Navbar
          </a>
          <button
            class="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span class="navbar-toggler-icon"></span>
          </button>
          <div class="collapse navbar-collapse" id="navbarSupportedContent">
            <ul class="navbar-nav ml-auto">
              <li class="nav-item">
                <a class="nav-link active" aria-current="page" href="#">
                  Home
                </a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href="#">
                  Link
                </a>
              </li>
              <li class="nav-item dropdown">
                <a
                  class="nav-link dropdown-toggle"
                  href="#"
                  id="navbarDropdown"
                  role="button"
                  data-bs-toggle="dropdown"
                  aria-expanded="false"
                >
                  Dropdown
                </a>
                <ul class="dropdown-menu" aria-labelledby="navbarDropdown">
                  <li>
                    <a class="dropdown-item" href="#">
                      Action
                    </a>
                  </li>
                  <li>
                    <a class="dropdown-item" href="#">
                      Another action
                    </a>
                  </li>

                  <li>
                    <a class="dropdown-item" href="#">
                      Something else here
                    </a>
                  </li>
                </ul>
              </li>
              <li class="nav-item">
                <a class="nav-link disabled">Disabled</a>
              </li>
            </ul>
          </div>
        </div>
      </nav>
    </StyledWrapper>
  );
};

//https://www.muscleandstrength.com/workouts/muscle-and-strength-womens-workout
//https://www.youtube.com/watch?v=dYjdzpZv5yc
//https://menubar.io/reactjs-tables
//https://www.youtube.com/watch?v=uduTSA_bkVY - make navbar to the right

const StyledWrapper = styled.div`
  .navbar {
    background-color: #e4f4fa;
    height: 40px;
    display: flex;
    justify-content: space-between;
  }
  .menu-items {
    display: flex;
    postion: absolute;
  }
  .menu-items li {
    padding: 1rem;
    color: grey;
    font-size: 1.2rem;
    padding: 0.3rem;
  }

  .menu-items :hover {
    border-bottom: 2px solid #24f4fa;
  }
`;
